import { useEffect, useState } from "react";
import styles from "./Home.module.css";
import netflixLogo from "../images/"
function Home({ name }) {
  const [time, setTime] = useState("");

  function ClockTick() {
    const date = new Date();
    const hour = String(date.getHours()).padStart(2, "0");
    const min = String(date.getMinutes()).padStart(2, "0");
    const sec = String(date.getSeconds()).padStart(2, "0");
    setTime(`${hour}:${min}:${sec}`);
  }
  setInterval(ClockTick, 1000);

  return (
    <div className={styles.home}>
      <main className={styles.homeMain}>
        <div className={styles.clock}>{time}</div>
        <div className={styles.container}>
          <div className={styles.links}>
            <a href="naver.com">
              <img src="data:image/jpeg;base64," />
            </a>
            <a href="google.com">
              <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTRuNBvuRPVJ2FoKASugZxJUatggHZ7bzb1JRLQkabd5A&s" />
            </a>
            <a href="github.com"></a>

            <a href="netflix.com">
              <img src={require("../images/netflix.jpg").default} />
            </a>
          </div>
          <div className={styles.todos}></div>
        </div>
      </main>
      <div></div>
      <button className={styles.logout}>Log Out</button>
    </div>
  );
}
export default Home;
